var _Tutorials = {
    "91301": "@<b>Authority of the Three Moons</b>#<br>\"The Doctor\" will punish the Traveler using the authority of the Three Moons.<br>Eternal Moon: Characters will move in the opposite direction of the keys pressed.<br>Frost Moon: If characters move quickly, they will be imprisoned and attacked by The Doctor's projections.<br>Iridescent Moon: If characters face towards The Doctor, they will be imprisoned and attacked by The Doctor's projections.<br>@<b>High DMG Punishment</b>#<br>If The Doctor takes a single instance of DMG exceeding a certain percentage of his HP, he will greatly increase all RES and heal a percentage of HP lost to this attack.<br>@<b>Moonwither Realm</b>#<br>The Doctor deploys the Moonwither Realm. Inside the realm there are continuous Electro lasers, Cryo pulses, and The Doctor's shadows that will attack the character. Defeat all shadows or find the exit to leave the realm<br>@<b>Moonfall Impact</b>#<br>Three Ancient Moon's Remnants descent from the skies, and The Doctor prepares Moonfall Impact. Take cover behind the Ancient Moon's Remnants, otherwise Moonfall Impact defeats the active character directly.",
    "22150106": "• Will create a Deepdark Shield equal to @45%# HP. It takes @300%# of the original DMG when hit by @Lunar Reaction DMG#, but is immune to Physical DMG. When the Shield takes Lunar reaction DMG for the first time, generates Elemental Orbs that revives @36# energy.<br>• When the Shield is destroyed, loses @20%# HP and becomes Weakened, all RES dropping to @-60%#.<br>• Will summon Anglers when charging Ult (each @18%# HP). Every Angler defeated reduces Shield by @25%#.",
    "26170105": "• Has @64U# Pyro horns that increase all RES by @150%#. Will lose @10%# HP when horns are destroyed.<br>• Will summon Sternshield Crabs that have @12U# Pyro. When their Pyro is depleted, will lose control and hit the Boss, making it lose @12U# Pyro.<br>• When the Boss is hit, it will alse lose HP based on the DMG the Sternshield Crab took, equal to @60%# Hydro DMG taken + @10%# other DMG taken, not exceeding @15%# Boss HP.",
    "21501": "• Will create a Deepdark Shield that blocks all DMG. The Shield can be damaged by @Elemental Attacks#, while @Lunar Reaction DMG# is greatly more efficient. Defeating its summons will also damage its Shield.<br>• When the Deepdark Shield is destroyed, @loses a large amount of HP# and becomes Weakened, @greatly reducing all RES#.",
    "22100304": "• Will consecutively generate @Electro#, @Pyro# and @Hydro# Elemental Shields. When each Shield is destroyed, the enemy will lose HP. The enemy will be weakened for a while when all 3 Shields are destroyed.<br>• Shield Value: @12U# / @18U# / @18U# (150% of overworld version)<br>• HP Loss: @50%# DMG taken by Shield, not exceeding @12.5%# Max HP, excluding Shield's Element.",
    "26240304": "• All RES @70%#, Cryo RES @110%#.<br>• Will levitate and gain a @Cryo Shield#, and @activate Elemental Burst# for all characters. @Cryo Gadgets# will appear on the ground. Destroy them to deal additional damage to the Shield. Loses HP when Shield is broken, and additionally takes extra fall DMG.<br>• There will be Decoy Vortexes that can be affected by @pull effects#. Decoy Vortexes decrease @35%# Anemo RES and destroy @2U# Shield upon hitting the enemy, max @3# stacks.<br>• Shield Value: @24U#. Gadgets @8U#, deals @9.6U# damage to Shield when destroyed.<br>• HP Loss: @10%# Max HP + @50%# DMG taken by Shield, not exceeding @35%# Max HP",
    "24080105": "• Will unleash a Gravity Reduction Field, making characters @jump significantly higher#, and unleash extremely powerful attacks on the ground that @cannot be dodged#. Every @5s#, massively enhances its attacks, but loses 1 stack of enhancement after being hit by @Plunge Attack#.<br>• When characters reach a certain height from below, ATK @+600%# for 1.5s.<br>• Actions that can trigger the buff: @<b><u>Lanyan</u></b># Skill, Ordinary jump, Varesa's & Gaming's special plunges.<br>• Actions that cannot trigger the buff: Flins Thunderous Symphony, Chasca Nightsoul, Mavuika Sunfell Slice.",
    "30901": "• Initially @all RES extremely high#. After taking @120# instances of @Pyro DMG#, enters Cooling state. Every @1U# Pyro application is considered 1 instances of DMG. When progress reaches 50%, @all RES decreases#.<br>• When cooling, generates a @Cryo Shield#. Destroy the Shield within time to weaken it, making @all RES further decrease#. Otherwise it will return to initial state.<br>• RES: @150%# / @50%# / @-20%#<br>• Shield: @28U# / @18s#. Loses @30%# current HP when weakened.",
    "40632": "• Will unleash a Gravity Reduction Field, making characters @jump significantly higher#, and unleash extremely powerful attacks.<br>• Has a @20U Geo Armor# that increases all RES by @200%#. Melee characters' Plunge Attacks are effective against the Armor.",
    "810": "• Will enter Gloomveiled state: All RES increases by @120%#, will exit after taking @50# instances of DMG. Lunar Reaction DMG is considered @6# instances of DMG.<br>• When exiting Gloomveiled, will absorb the @Element it took the most DMG from#, gaining @Immunity# and @permanent application# of this Element. If it took more Lunar Reaction DMG or Physical DMG, this will not happen.",
    "20081101": "• Will enter Gloomveiled state: All RES increases by @120%#, will exit after taking @50# instances of DMG. Lunar Reaction DMG is considered @6# instances of DMG.<br>• When exiting Gloomveiled, will absorb the @Element it took the most DMG from#, gaining @Immunity# and @permanent application# of this Element. If it took more Lunar Reaction DMG or Physical DMG, this will not happen.",
    "23060503": "• Frozen RES @+90#. Interruption RES completely amplified, making characters abilities impossible to interrupt. Has a large number of swift movement skills.<br>• When Shield is not active, will perform Hunt Down and generate Shield equal to @22.5%# HP. Will lose the same amount of HP when Shield is broken.<br>• Upon gaining Shield, applies @27100# / @29028# Bond of Life to all characters, and an extra @8130# / @8708# every second when Shield is active. (N5/N6)",
    "21310": "• Will not die when HP drops to 0. Instead, enters the Grief-Stricken state, and @recovers to Max HP# after a while. When characters use abilities enhanced by @Ascendant Gleam#, Wile Hunt will @directly enter Grief-Stricken#.<br>• Grief-Stricken: Based on whether the team is at @Ascendant Gleam#, <u>Max HP</u> will be reduced by @65%# / @90%# of DMG taken. Will only die when @<u>Max HP</u> drops to 0#.",
    "21320": "• Has @2# layers of HP, the 1st human, the 2nd Wild Hunt.<br>• Wild Hunt: Will not die when HP drops to 0. Instead, enters the Grief-Stricken state, and @recovers to Max HP# after a while. When characters use abilities enhanced by @Ascendant Gleam#, Wile Hunt will @directly enter Grief-Stricken#.<br>• Grief-Stricken: Based on whether the team is at @Ascendant Gleam#, <u>Max HP</u> will be reduced by @65%# / @90%# of DMG taken. Will only die when @<u>Max HP</u> drops to 0#.<br>• Wild Hunt Exiles will appear. After a while, the Boss eliminates all Wild Hunt Exiles, and @heals own HP# based on their remaining HP.",
    "22132005": "• Frozen RES @90#. Has a large number of swift movement skills.<br>• The 2nd layer of HP is Wild Hunt: Will not die when HP drops to 0. Instead, enters the Grief-Stricken state, and @recovers to Max HP# after a while. When characters use abilities enhanced by @Ascendant Gleam#, Wile Hunt will @directly enter Grief-Stricken#.<br>• Grief-Stricken: Based on whether the team is at @Ascendant Gleam#, <u>Max HP</u> will be reduced by @65%# / @90%# of DMG taken. Will only die when @<u>Max HP</u> drops to 0#.<br>• Wild Hunt Exiles will appear. After a while, the Boss eliminates all Wild Hunt Exiles, and @heals own HP# based on their remaining HP.",
    "510": "• Water Phantasms will enter Rage after spending 15s in normal mode. Rage lasts 20~30s.<br>• When Rage ends, returns back to normal and starts the cycle again.<br>• Cannot be Frozen in Rage mode.<br>• If Frozen for more than 8s in normal mode, removes Frozen and enters Rage immediately.",
    "5101": "• Local Legend Phantasm: Always in Rage Mode, always immune to Frozen.",
    "512": "• Summons a Half-Tulpa every 15s. Half-Tulpas can be destroyed by Elemental Reactions.<br>• During combat, will attempt to absorb Half-Tulpas to enter Rage State: @All RES increased by 45%, and greatly boosts DMG dealt. Rage lasts for one skill.#<br>• Abyss Version: @First Absorb will be used later, while first Rain of Blades will be used earlier. In Rage state, will use 2 skills consecutively, with 0 interval.#",
    "601": "• Taking single instance DMG between 18.75% and 31.25%: +20% Rage.<br>• Taking single instance DMG between 31.25% and 43.75%: +40% Rage.<br>• Taking single instance DMG between 43.75% and 56.25%: +70% Rage.<br>• Taking single instance DMG greater than 56.25%: +100% Rage.",
    "20201": "Some of its attacks have the \"Abyssal Infusion\". When such attacks deal DMG to the character, all skills currently in CD will have their CD increased by 6s.",
    "20202": "Some of its attacks have the \"Abyssal Infusion\". When such attacks deal DMG to the character, the character loses 50 stamina. If triggered again within 3s, will only deduct 20 stamina.",
    "20301": "Some of its attacks have the \"Abyssal Infusion\". When such attacks deal DMG to the character, all party members lose 20 Elemental Energy.",
    "20302": "Some of its attacks have the \"Abyssal Infusion\". When such attacks deal DMG to the character, all party members lose a part of their HP. Shields do not resist HP loss.",
    "20701": "When its attacks fail to break a shield, provides 6U <color style='color: #FF0000;'>Pyro Shield# lasting 15s for all Shadowy Husks and Black Serpent Knights on field.",
    "20702": "When its attacks fail to break a shield, heals 10% Max HP for nearby Shadowy Husks and Black Serpent Knights.",
    "20703": "When its attacks fail to break a shield, ATK is increased by 30% and gains a tough shield able to block all DMG from the front for 30s. This effect can stack, max 5 stacks. When launched intp the air, loses this effect.",
    "20801": "When its attacks fail to break a shield, becomes able to dodge the character's next attack. After dodging, DMG dealt is increased.",
    "20802": "When its attacks fail to break a shield, enter Rampage State: All RES +50%, all DMG are converted to <color style='color:#D4A000;'>Geo DMG# and are greatly increased.",
    "21101": "• Every 25~35s, performs @Ultimate#: Under the Enhancement of 6U Geo Element, unleash deadly Stonefall attacks, lasting 20s.<br>• Breaking the Geo Enhancement with reactions or attacking it @1 time with Pnuema or Ousia# will paralyze it for 15s.<br>• The Enhancement does not affect its DMG taken. Spiral Abyss Version uses Ultimate immediately after entering battle.",
    "21102": "• Every 25~35s, performs @Ultimate#: Under the Enhancement of 2U Geo Element, unleash deadly Stonefall attacks, lasting 20s.<br>• Breaking the Geo Enhancement with reactions or attacking it @1 time with Pnuema or Ousia# will paralyze it for 15s.<br>• The Enhancement does not affect its DMG taken. Spiral Abyss Version uses Ultimate immediately after entering battle.",
    "21103": "• Every 25~35s, performs @Ultimate#: Under the Enhancement of 4U Dendro Element, unleash deadly Lushmissile attacks, lasting 20s.<br>• Breaking the Dendro Enhancement with reactions or attacking it @1 time with Pnuema or Ousia# will paralyze it for 15s.<br>• The Enhancement does not affect its DMG taken. Spiral Abyss Version uses Ultimate immediately after entering battle.",
    "21104": "• Every 25~35s, performs @Ultimate#: Under the Enhancement of 2U Dendro Element, unleash deadly Lushmissile attacks, lasting 20s.<br>• Breaking the Dendro Enhancement with reactions or attacking it @1 time with Pnuema or Ousia# will paralyze it for 15s.<br>• The Enhancement does not affect its DMG taken. Spiral Abyss Version uses Ultimate immediately after entering battle.",
    "21201": "• During Void Fantasia, its frequency shield Void Barrier will @appear for 15s#, blocking all DMG. This requires @53 Elemental attacks# (Domain Version @72#) to destroy. Nightsoul-attribute attacks @are considered as 3 attacks#.<br>• Domain Version @all RES increased to 70%#. Destroy the Void Barrier while it exists and @all RES will be reduced for some time#.<br>• During Void Fantasia, will constantly attack, @consuming the character's HP upon hit, ignoring shields#. If the Void Barrier is not destroyed in time, will additionally consume HP equal to @60% Max HP + 3000#, and deal @massive Physical DMG# to the entire arena.",
    "21202": "• An abyssal creature manifesting as an enemy from Teyvat. It has more powerful skills than the original enemy and @can teleport#.<br>• Its frequency shield \"Void Barrier\" blocks all DMG and requires @40/70/105 Elemental attacks# to destroy depending on the type of enemy. Nightsoul-attribute attacks @are considered as 3 attacks#.<br>• Certain attacks will cause the active character to lose HP, @ignoring shields#. The maximum single instance HP loss is @18% Max HP + 900#.",
    "30601": "• Every 20s, will perform Hunt Down: @Consume 5% HP# to unleash Hunting Attacks. It its HP is low, the comsumed amount will decrease.<br>• When Hunting Attacks hit a character, it @regenerates 10% HP#, and inflicts Bond of Life on the character, stackable.<br>• Bond of Life causes the character to @lose HP over time# even under a shield, and absorbs incoming healing, making the character unable to be healed. To clear the Bond of Life, total healing received must reach the Bond's amount.<br>• When Hunting Attacks hit a character with Bond of Life, it @deals 250% of the original DMG#.<br>Bond of Life amount: 16% ATK, stackable. HP Loss: 0.4%+72 every second, off-field stops at 5%.",
    "30603": "• Has 90% resistance to Freeze.<br>• Every 20s, will perform Hunt Down: @Consume 5% HP# to unleash Hunting Attacks. It its HP is low, the comsumed amount will decrease.<br>• When Hunting Attacks hit a character, it @regenerates 10% HP#, and inflicts Bond of Life on the character, stackable.<br>• Bond of Life causes the character to @lose HP over time# even under a shield, and absorbs incoming healing, making the character unable to be healed. To clear the Bond of Life, total healing received must reach the Bond's amount.<br>• When Hunting Attacks hit a character with Bond of Life, it @deals 250% of the original DMG#.<br>Bond of Life amount: 16% ATK, stackable. HP Loss: 0.4%+72 every second, off-field stops at 5%.",
    "40304": "• Every 20s, will absorb the Element type that it @took the most DMG from# in the previous cycle, @increasing corresponding RES by 120%#. Immobilizing it by hitting its weakness @will not remove this effect#.<br>• Local Legend: The effect of Freeze on it is @reduced by 90%#.",
    "40601": "• Small Ousia mek, masters the <color style='color:#7030A0;'>Electro# element.<br>• Attacking it with Pneuma 1 time will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40602": "• Ousia enhancement mek. Increases nearby meks' ATK by 20% and recovers nearby weakened meks.<br>• Attacking it with Pneuma 1 time will weaken it for 5s.",
    "40622": "Initially has @Ousia Power#, granting @<color style='color:#D4A000;'>a 20GU Geo Armor## which increases all RES by 200%. After the armor is destroyed, using 1 Pneuma attack can cause annihilation: terminate Ousia Power and immobilize it for 5s. Cannot annihilate when armor is still on.<br>• While in Ousia Power, immune to Freeze and Petrification. After Pneumosia annihilation, still has 90% Freeze RES.<br>• Regains Ousia 12s after annihilation. Regains armor 15s after destruction of armor.",
    "40603": "• Small underwater Ousia mek.<br>• Attacking it with Pneuma 1 time will weaken it for 50s.<br>• While weakened, cannot perform any action.",
    "40604": "• Small Ousia mek, masters the <color style='color:#D4A000;'>Geo# element.<br>• Attacking it with Pneuma 1 time will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40608": "• Mid-tier Ousia mek, masters the <color style='color:#7030A0;'>Electro# element.<br>• Attacking it with Pneuma 2 times will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40609": "• Mid-tier Ousia mek, masters the <color style='color:#FF0000;'>Pyro# element.<br>• Attacking it with Pneuma 2 times will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40610": "• Mid-tier Ousia mek, masters the <color style='color:#0070C0;'>Hydro# element.<br>• Attacking it with Pneuma 2 times will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40611": "• Small Ousia mek, masters the <color style='color:#00B0F0;'>Cryo# element.<br>• Attacking it with Pneuma 1 time will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40612": "• Mid-tier Ousia mek, masters the <color style='color:#00B0F0;'>Cryo# element.<br>• Attacking it with Pneuma 2 times will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40651": "• Small Pneuma mek, masters the <color style='color:#7030A0;'>Electro# element.<br>• Attacking it with Ousia 1 time will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40652": "• Pneuma enhancement mek. Increases nearby meks' ATK by 20% and recovers nearby weakened meks.<br>• Attacking it with Ousia 1 time will weaken it for 5s.",
    "40653": "• Small underwater Pneuma mek.<br>• Attacking it with Ousia 1 time will weaken it for 50s.<br>• While weakened, cannot perform any action.",
    "40654": "• Small Pneuma mek, masters the <color style='color:#0070C0;'>Hydro# element.<br>• Attacking it with Ousia 1 time will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40657": "• Small Pneuma mek, masters the <color style='color:#00B050;'>Anemo# element.<br>• Attacking it with Ousia 1 time will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40658": "• Mid-tier Pneuma mek, masters the <color style='color:#FF0000;'>Pyro# element.<br>• Attacking it with Ousia 2 times will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40659": "• Mid-tier Pneuma mek, masters the <color style='color:#70AD47;'>Dendro# element.<br>• Attacking it with Ousia 2 times will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40660": "• Mid-tier Pneuma mek, masters the <color style='color:#7030A0;'>Electro# element.<br>• Attacking it with Ousia 2 times will weaken it for 25s.<br>• While weakened, loses its element and can only perform basic Physical attacks.",
    "40701": "• Coppelius is the main character of the performance <i>Icewind Suite: Nemesis of Coppelius</i>. The performance reaches it climax after 30s or after HP falls below 71%.<br>• At the climax of the performance, Coppelius will move to the center of the stage and summon three Frosthearts of Retribution. At the start of every section of the climax, he refreshes an 8U Cryo Shield.<br>• @Attacking him with Ousia 1 time# will annihilate his Shield. @Attacking him with Ousia 3 times# will terminate the climax.<br>• If not terminated, the climax will finish after 3 sections. Each section lasts for 12s. The next climax starts 30s after the previous one finishes.",
    "40702": "• Coppelia is the main character of the performance <i>Icewind Suite: Dirge of Coppelia</i>. The performance reaches it climax after 30s or after HP falls below 71%.<br>• At the climax of the performance, Coppelia will move to the center of the stage, summon countless Whirlwinds of Dirge and @increase all-type RES by 25%#. <br>• @Attacking her with Pnuema 1 time# will remove the RES increase and reduce her DMG. @Attacking her with Pnuema 3 times# will terminate the climax.<br>• If not terminated, the climax will finish after 3 sections. Each section lasts for 12s. The next climax starts 30s after the previous one finishes.",
    "40801": "• In battle, it will periodically launch @Ousia Power#, creating anti-gravitational fields around it, greatly increasing characters' jump height (Equivalent to Xiao's Burst). While Powered, it will launch dangerous attacks on the ground.<br>• Use the anti-gravitational field to jump high into the air and avoid its attacks. @Using 3 Pneuma attacks# will terminate the Ousia Power. Ousia Power will fade after 1 minute, but will relaunch after 30s.<br>• The Overworld version will launch Power after its HP drops below 70%. The Abyss version will launch immediately after entering battle.",
    "60406": "@<color style='color:#FF0000;'>\"The Rising Fire: Yiji\"## and @<color style='color:#00B0F0;'>\"The Imminent Freeze: Tianyu\"## are a twin Local Legend of Liyue. They are @immune to Petrification#, and are permanently enhanced with Pyro and Cryo. They have 70% Pyro/Cryo RES, 50% Geo RES and 30% Physical RES.<br>• If one of the Geovishaps is killed but the second is not killed within 15s, the first Geovishap will revive.<br>• In combat, they will unleash powerful cooperated attacks. If certain attacks are not blocked by a shield, they will perform extra follow-up attacks.",
    "60512": "After 30s, will generate a @ 16U Hydro Armor#, increasing all RES by 80%, and summons a big Aura Field around itself. When armor is destroyed, will remove RES increase and Aura Field.<br>Characters within the Aura Field will @lose 10 Elemental Energy# every 0.5s. If energy is insufficient, will instead @lose HP equal to 10% Max HP + 100#.",
    "61401": "Has @32U Geo Armor#, 4 times the strength of Geo Slimes and 1.6 times the strength of the Local Legend Field Generator.<br>Will regenerate the armor 10s after it was destroyed. Every 30s, a Musical Note will appear. Hitting the Note 6 times will destroy it and consume 20% of the Geo Armor.",
    "61402": "Has @12U Geo Armor#, 1.5 times the strength of Geo Slimes and 0.6 times the strength of the Local Legend Field Generator. Will regenerate the armor 8s after it was destroyed.",
    "61601": "• Initially has a @10.8U Pyro Enhancement#: While Enhanced, all RES increase 60% and unleash powerful attacks.<br>• Breaking the Pyro Enhancement will make its attacks less fierce.",
    "61602": "• Initially has a @10.8U Cryo Enhancement#: While Enhanced, all RES increase 60% and unleash powerful attacks.<br>• Breaking the Cryo Enhancement will make its attacks less fierce.",
    "61603": "• Initially has a @7.2U Electro Enhancement#: While Enhanced, all RES increase 60% and unleash powerful attacks.<br>• Breaking the Electro Enhancement will make its attacks less fierce.",
    "61701": "• Initially, @the molten horns located high up on its body contains <color style='color:#FF0000;'>16U Pyro##: The horn will increase its all RES by 60% (Abyss Version 80%), and it will unleash deadly attacks, creating Molten Areas that deal massive DoT.<br>• Molten horns are immune to Swirl's element application, and are only reachable when it unleashes certain attacks. Seize this opportunity and destroy it with reactions.<br>• After the horns are destroyed, it will lose all enhancements, but will regenerate its molten horns after 30s (Abyss Version 20s).<br>• Spiral Abyss Version will gain an extra 33% ATK boost, and will create even more Molten Areas.",
    "61801": "• Initially, @the Millennial Pearl under its head contains<color style='color:#7030A0;'>19U Electro##: The Pearl will increase its all RES by 60% (Abyss Version 80%), and it will unleash deadly attacks, creating Electrified Areas that deal massive DoT.<br>• When the Pearl's Element drops below 7U, it will call for the Fontemer Hoarthunder, summoning three Hearts of Storm, which contain 0.4U Electro. Destroying each Heart will cause the Pearl to @lose a third of its durability#<br>• During the 15s call, the Fontemer Hoarthunder will continuously descend. If not all Hearts are destroyed in time, each remaining Heart @reviving a third of the Pearl's durability plus 2GU#.<br>• After the Pearl is destroyed, it will regenerate its Pearl after 30s (Abyss Version 20s). Regenerated Pearl's durability @decreases to 11.4GU#.",
    "61901": "A beast dwelling in the deep mountains. It will periodically draw upon the adeptal powers and alternately unleash @Hydro Ult# and @Anemo Ult#. During its Ults, all-type RES is increased by 200% for 10s.<br><br>Hydro Ult: Continuously deal Hydro DMG in random surrounding areas. In the end, summon deadly tides in 7 huge circles, dealing massive Hydro DMG.<br>@During the Ult it will apply Hydro to itself. Freeze it with Cryo attacks and destroy its Frozen state with the <color style='color:#f29e38;'>Superconduct, Melt, Swirl, Crystallize or Shatter# Reactions to remove its RES increase and temporarily paralyze it.#<br><br>Anemo Ult: Summon 3 moving Gale Orbs and continuously deal Anemo DMG in random surrounding areas. In the end, deal massive Anemo DMG to the entire arena. The Gale Orbs will transform into vertexes, pulling characters in and dealing Anemo DoT. <br>@Swirl all three Gale Orbs with the <color style='color:#f29e38;'>Electro, Hydro, Cryo or Pyro Elements# to remove its RES increase and temporarily paralyze it.#<br><br>Hydro and Anemo Adeptal Powers are used alternately, at intervals of 30s~60s. The first is always Hydro. When HP falls below 70%, uses Hydro Ult ignoring interval. When HP falls below 40%, uses Anemo Ult ignoring interval.",
    "61902": "A beast dwelling in the deep mountains.<br>• Freezing it, and then destroying its Frozen state with Elemental Reactions, will temporarily paralyze it.",
    "90901": "• The BOSS accumulates Rage during combat. @When Rage reaches 120, will devour you, taking you to another realm#. To return to reality, you must defeat the Phantom inside the realm. Upon defeating the Phantom, the BOSS will @lose 20% HP#, and every party member revives 100 Elemental Energy.<br>• The BOSS gathers 1 Rage every second; after 80 seconds, will instead gather 2 Rage every second. Each time it takes damage, every 1% HP lost will increase Rage by 1. Destroying an Eye of Maelstrom will gather 30 Rage.<br>• Eyes of Maelstrom will appear in battle, pulling characters in and dealing massive DMG. To destroy it, either attack it 8 times, or @attack it once with Ousia or Pneuma#.<br>• The Phantom in the other realm has 60% HP of the BOSS, and will unleash powerful attacks. @Correctly timed Ousia or Pneuma attacks# will paralyze it and cause it to @lose 25% HP#.",
    "90902": "• The BOSS accumulates Rage during combat. @When Rage reaches 120, will devour you, taking you to another realm#. You cannot deal damage to the BOSS in the realm. To return to reality, you must defeat the Phantom inside the realm. Upon defeating the Phantom, the BOSS will @lose 20% HP#, and every party member revives 100 Elemental Energy.<br>• The BOSS gathers 1 Rage every second; after 80 seconds, will instead gather 2 Rage every second. Each time it takes damage, every 1% HP lost will increase Rage by 1. Destroying an Eye of Maelstrom will gather 30 Rage.<br>• Eyes of Maelstrom will appear in battle, pulling characters in and dealing DMG. To destroy it, either hit it 8 times, or @attack it once with Ousia or Pneuma#.<br>• The Phantom in the other realm has 60% HP of the BOSS, and will unleash powerful attacks. @Correctly timed Ousia or Pneuma attacks# will paralyze it and cause it to @lose 25% HP#.",
    "90903": "• Accumulates Rage during combat. @When Rage reaches 120, will devour you, taking you to another realm#. To return to reality, you must defeat the Phantom inside the realm. Upon defeating the Phantom, the BOSS will @lose 20% HP#, and every party member revives 100 Elemental Energy.<br>• The BOSS gathers 1 Rage every second. Each time it takes damage, every 1% HP lost will increase Rage by 1. Destroying an Eye of Maelstrom will gather 30 Rage.<br>• Eyes of Maelstrom will appear in battle, pulling characters in and dealing massive DMG. To destroy it, either attack it 8 times, or @attack it once with Ousia or Pneuma#.<br>• The Phantom in the other realm has 60% HP of the BOSS, and will unleash powerful attacks. @Correctly timed Ousia or Pneuma attacks# will paralyze it and cause it to @lose 25% HP#.",
    "91001": "When The Knave casts certain skills, she will consume 1.5% HP. If the skill hits a character, she will heal 3% HP and inflict Bond of Life, causing the character to lose HP over time.<br>If the character already has Bond of Life, she will deal 250% of the original DMG.",
    "3700701": "Challenge the Crackling Thunder Manifestation.<br>Who knows what miseries the grieving, confused Thunder Manifestation that wanders here has witnessed. It transforms its hatred into fierce lightning regardless of what living thing it detects, and it will try to completely destroy everything, until it is left alone amidst deafening silence...",
    "3740303": "Challenge the Aeonblight Drake (Heavy Assault Pack).<br>It appears no different from an Aeonblight Drake, but comes with even more dangerous weaponry that heretofore has only appeared in legends and a small number of reports. Now, it roams this mysterious Domain, directing its fearsome firepower against all it detects...",
    "3760507": "Challenge the Booming Bathysmal Vishap Herd: the Frostshrieker and the Blitzroarer.<br>Having barged into this area, the Bathysmal Vishaps will struggle to return whence they came. Having sensed danger nearby, they will now attack any who would pose a threat to them with great might and savagery...",
    "4660501": "@Live# Highest difficulty: No character buffs, time limit 90s.<br>Every 25s, will switch between the Cryo and Hydro states, @increasing corresponding RES by 100%#. Initially under Cryo state, and the first switch is 10s into the battle.<br>Every 40s, will unleash \"Primordial Shower\", dealing massive DMG. If the character has a shield, this will only deal 20% of the original DMG. If the shield is not broken by the DMG, it will backfire, the Primo Geovishap will lose 3% HP and have all RES temporarily lowered.",
    "4660202": "@Live# Highest difficulty: No character buffs, time limit 90s.<br>High up on its head is a @<color style='color:#FF0000;'>36U# Pyro Primary Core#, 3 times the GU of Pyro AbyssMages' shield.<br>After destroying the Primary Core, will unleash Firestorm, blowing characters to the edge of the arena instantly, and summon a @<color style='color:#FF0000;'>4U# Pyro Secondary Core# at its root.<br>After destroying the Secondary Core, it will fall into paralysis for 15s, during which all RES is greatly decreased. After recovering, will regenerate its Primary Core.",
    "4661101": "@Live# Highest difficulty: No character buffs, time limit 90s.<br>Initially has @<color style='color:#70AD47;'>10U# Dendro Armor#, increasing all RES. Destroying the armor will remove the RES increase.<br>When taking Electro DMG or suffering from Aggravate or Spread Reactions, will gain Energy. When taking Pyro DMG, will lose all Energy.<br>When Energy reaches its limit, will unleash powerful attacks for 10s~20s, then fall into paralysis for 16s.<br>After recovering, will regenerate its Dendro Armor.",
    "4661801": "@Live# Highest difficulty: No character buffs, time limit 90s.<br>Initially has a @<color style='color:#7030A0;'>19U# Electro Millennial Pearl#, increasing all RES by 100%.<br>When Millennial Pearl drops to 7U by reactions, will unleash Fontemer Hoarthunder and summon 4 @swiftly moving# Electro Cores, each 0.4U Electro.<br>If all Cores are destroyed in time, the Millennial Pearl is destroyed and all RES increase is removed. The Millennial Pearl will respawn after 18s.<br>If the Cores are not destroyed in time, the Millennial Pearl will regenerate Electro GU.",
    "40901": "• In normal state, @all RES is increased# by 10% more than Consecrated Beasts.<br>• When nearby characters enter Nightsoul's Blessing, will accumulate @15%# Energy, and accumulate @15%# every second during Nightsoul's Blessing. Different character's Nightsoul can stack this effect.<br>• After reaching @100%# Energy (@170%# for Abyss version), will unleash a powerful laser and become weakened for a while.<br>• During laser and weakened states, @the RES increase will be removed#.",
    "40902": "• In normal state, @all RES is increased to 60%#, which is 20% higher than Consecrated Beasts.<br>• Will perform Ult after @40s#. Using Nightsoul will make Ult come earlier. Ult creates @Solid Phlogiston pillars#.<br>• Climb and attack the 2 cores on the pillars to interrupt the Ult, causing it to @lose 15% HP#, and @greatly reduce all RES#.",
    "30111": "• These Skirmisher Local Legends have the same Elemental Armor as their ordinary versions, but these Armors are @ready immediately upon entering combat#.<br>• When Pyroslinger is defeated, @increases all teammates' ATK by 200%#.<br>• When Cryogunner is defeated, @will generate a huge area of ice fog, dealing massive DoT#. Pyroslinger will walk to the center of the ice fog.<br>• When Electrohammer is defeated, recovers all teammates' @Elemental Armor to 100%#, and triggers an explosion, @dealing massive massive massive massive DMG in a large area#.",
    "30211": "• When not weakened, it is @permanently invisible#.<br>• After a while, will @summon 4 Shadowblades#, each having @6U Pyro# and require reactions to destroy.<br>• @Destroying the real Shadowblade# will shortly weaken the enemy, while fake ones explode, dealing DMG",
    "62203": "• Has very high HP. Will periodically create @3 Flamegranates# and swallow them one by one to perform its Ultimate, dealing massive Pyro DMG according to the number of Flamegranates swallowed.<br>• @Pyro# can ignite the Flamegranates. After swallowing an ignited Flamegranate, will @lose HP equal to 5% Max HP#. If an ignited Flamegranate explodes, it will deal massive Pyro DMG to both the enemy and characters.<br>• Abyss Version: After entering combat, will perform an Ultimate equal to having swallowed 3 Flamegranates, without actually creating and swallowing any.",
    "62303": "• Will switch between the Golden Flame state and normal state, lasting @45s/45s# respectively. Abyss version is @90s/30s#, and enters Golden Flame immediately in battle.<br>• During Golden Flame, will gain a @24GU Pyro Shield#, and will fly extremely high into the air and swoop down, over and over again. When the shield is broken, will exit this state.<br>• Every time before it takes off, will summon a @2GU Pyro Feather# (Abyss version 2 Feathers). If all Feathers are destroyed before the swoop, will decrease the massive DMG dealt by the swoop. (v3)",
    "62601": "• Trial Arena lasts for @13s#, giving the Wayob a non-Elemental white Shield, maximum strength equal to @112%# of own Max HP. DMG to the Shield cannot be magnified by Amplifying Reactions, and it is @immune to Freeze and Petrify#.<br>• During the Trial, all characters lose all Elemental Energy and cannot gain any Energy, but their @DMG dealt is increased by 120%#, and DMG with the Nightsoul attribute is @additionally increased by 60%#.<br>• If the white Shield is broken within the Trial, the DMG boost and Energy loss effects will be removed, and will generate a large amount of orbs, @reviving 90 Energy#. Otherwise, the Wayob will gain an Elemental Shield according to the amount of remaining white Shield.<br>• Max Elemental Shield: <b><Rock>Geo 24# / <Grass>Dendro 24# / <Water>Hydro 48#/ <Ice>Ice 48#/ <Fire>Pyro 48#/ <Elec>Electro 22.8#",
    "62604": "• During this trial, you can only use the Traveler. The Traveler will be unable to use Elemental Skills or Bursts, but will gain a new Elemental Skill: Parry.<br>• When you use Parry, you will raise your weapon up in a defensive posture, greatly decreasing DMG dealt to you. This Skill has a fixed CD.<br>• Get the timing down and @Parry just as the opponent is attacking# to completely negate the DMG you should have taken and reset Parry CD.",
    "62605": "• Has an invincible Shield and will summon a long-lasting stream of water, @dealing massive DoT# that only characters with extremely high DMG reduction can survive.<br>• @Use Cryo to freeze its springs# and block the DMG. Frozen bubbles can be hit towards the opponent, dealing DMG to its Shield.",
    "62606": "• Has extremely high HP. Will periodically @exile# the character into the Land of Decision, in which continuously spawns Nightsoul Warriors with DoT auras.<br>• For every Nightsoul Warrior defeated, all characters @receive DMG Bonus#, but will also @lose HP over time#, stackable.<br>• You can exit the Land of Decision at any time and return to the Boss fight. The HP loss will be removed upon exiting, but the DMG Bonus will persist for a while.",
    "62702": "• When @taking Pyro DMG#, or @being applied the Pyro element#, will accumulate Complete Combustion.<br>• When Complete Combustion reaches 20%, 40%, or 60%, will @lose large amounts of HP#.<br>• When Complete Combustion reaches 100%, will @die immediately#.",
    "55151": "• @Dodging the opponent's attacks# will cause the character's next attack to deal massive True DMG.",
    "55152": "• Uses both the Cryo and Hydro elements.<br>• @When the character is Frozen#, will instantly blink to the character's position to perform a heavy attack, dealing high Hydro DMG and @triggering Shattered#. DMG dealt by Shattered is @increased by 333%#.",
    "55153": "• Will throw 3 @Dendro grapples# and hook herself into the air, increasing all RES by 100%.<br>• @Destroy her grapple with Elemental Reactions# to make her fall to the ground.",
    "28021301": "• After @taking 34 instances of DMG#, will enter Rage and @gain a 16U Electro Shield#<br>• When the Shield is @attacked by a character#, if the character is not very far away, will launch a counter attack on the character. This attack cannot be dodged.<br>• Achievements: Defeat without it entering Rage / Defeat after it entered Rage but without triggering counter.",
    "28022601": "• Will perform a @15s# charge, dealing massive DMG upon completion<br>• Performing attacks with high interruption will accumulate interruption. After accumulating enough interruption, the enemy will be weakened.",
    "62607": "• The Wayob will invoke the Heavenly Flames on the entire arena. Avoid them by flying into the air via the Gaseous Phlogiston fields. You can also interrupt the invocation by swooping on the Wayob using Gaseous Phlogiston.",
    "62610": "• The Wayob will manifest into Protection Spirits and Hostile Spirits.<br>• When a character is healed, the Protection Spirits will also heal. When they accumulate enough healing, they will attack the Hostile Spirit.",
    "62403": "• Characters close to the sacrificial braziers deal additional Pyro DMG with their Charged Attacks.<br>• The Iktomisaurus will float in the air and @gain an Ice Shield#, @freeze the sacrificial braziers#, and unleash powerful attacks.<br>• Unfreeze the sacrificial braziers with Pyro, or use characters from the Masters of the Night-Wind to create new sacrificial braziers.",
    "55162": "• The enemy will create Molten Barbs, which explode after a while, dealing massive DMG.<br>• Use @Geo attacks# or @Plunge Attacks# to destroy the Molten Barbs before they explode. Destroying them with Plunge Attacks will cause the enemy to @take additional DMG#.",
    "5340902": "ATK @77138#<br>• The Secret Source Automaton will create a Phlogiston area behind it. Characters within this area will @continuously revive Phlogiston#, and @DMG dealt is increased by 5%#<br>• When charging its Ultimate, @all RES increases by 300%#, and the height of the solid Phlogiston pillars are @greatly increased#.<br>• The Ultimate @downs all currently active characters#, ignoring shields and Burst invincibility.",
    "5361401": "ATK @65270#<br>• The Legatus Golem has an @84U Geo Armor# which @immensely increases all RES#<br>• When armor falls below 19U, will @recover 6U# every 3s, until it reaches 56U<br>• The Legatus Golem will summoon 3 resonators, each @6U Geo#, that respawns 13s after being destroyed.<br>• If all 3 resonators are destroyed, the Legatus Golem loses @42U armor# and @12.5% HP#.",
    "5300512": "ATK @59337#<br>• The Hydro Tulpa will periodically summon Half-Tulpas, each @4.8U Hydro#. Every time a Half-Tulpa is summoned, replenishes the number of Half-Tulpas to 3.<br>• When beginning to charge its Ultimate, wll gain a White Shield equal to @23.88% Max HP#, @regenerate all Energy and Fighting Spirit# for all characters, @and resets the CD of all characters' Elemental Skill and Elemental Burst#. Breaking the shield will cause it to lose the same amount of HP.<br>• The Ultimate @downs all currently active characters#, ignoring shields and Burst invincibility.",
    "5361701": "ATK @71204#<br>• Its Molten Horns has @96U Pyro#, and @increases all RES by 120%#<br>• When charging its Ultimate, will summon 2 Molten Crystals, each @14U Pyro#. Destroying both Crystals will cause the Molten Horns to @lose 24U Pyro#<br>• If not all Crystals were destroyed in time, it will cast its Ultimate, and every existing Crystal recovers @12U Pyro# for its Molten Horns.<br>• The Ultimate @downs all currently active characters#, ignoring shields and Burst invincibility.",
    "55201": "• Will hide herself and create 4 Reflections that attack you, each with a @8U Frozen Shield# (same as Large Cryo Slimes)<br>• Destroying each Reflection will @make the Boss appear for 4s#. Destroying all reflections will @immobilize the Boss for 14s#, during which @all RES decreases by 40%#.<br>• Scanning the Reflections with Iktomisauri or characters from the Masters of the Night-Wind will @temporarily immobilize them# and cause them to @lose 2U Shield#.",
    "62901": "• Will burrow underground and leave behind a Secret Source Core, which has a White Shield equal to @100%# Max HP. When hit by a @Plunging Attack#, will lose an extra @25%# Shield.<br>• When Shield is broken, loses HP equal to @15%# non-Plunge DMG + @160%# Plunge DMG taken by Shield, not exceeding @50%# Max HP.",
    "62703": "• @Abyss Version# - Initially in Geohuman state: All RES @150%#, every Pyro hit @+2%# charge, Pyro application @+6.8%# charge per 1U.<br>• When fully charged, evolves into Molten Dragon: @Permanent Pyro aura#, Pyro RES @150%#, other RES @45%#, every Pyro hit @+1%# charge, Pyro application @+3.4%# charge per 1U. When hit by @Cryo# or @Hydro#, loses @22%# charge.<br>• When fully charged again, becomes Weakened: All RES @10%# for @17s#, then returns to Geohuman form.",
    "40905": "• Will enter Enhanced State: All RES @210%#, and accumulates Energy to perform spinning attacks.<br>• When Enhanced, if you @keep dealing Cryo DMG# at a higher frequency than @once per 0.8s#, it will enter Low Energy state: Cryo RES becomes @-40%#, other RES @0%#.<br>• When Enhanced, if it detects characters uing @Nightsoul#, will enter a special state: All RES @50%#, and switch to attacking with tracking rays.",
    "91200": "<b>Phase 1</b> Face the King Piece first, then then Queen Piece.<br><b>Phase 2</b> Simultaneously face the Ascended King and the Sublimated Queen. After one Piece is defeated, it will either @revive# or @greatly increase DMG dealt# by the other Piece.<br><b>Ultimate</b><br>• @Charge the Progress Bar# to stop the Ult! Progress can only be gained by dealing @Cryo# DMG. Triggering @Freeze# gives extra progress, dealing @Pyro# DMG will lose a lot of progress.<br>• If progress was not fully charged, the Ult will instantly defeat a character, @ignoring Shields and Burst Invincibility#.",
    "20051205": "• After entering battle, and every @30s# afterwards, summons 2 Half-Tulpas: Has @12%# HP and @12U# Hydro Shield ( = Hydro Abyss Mage), which dies instantly if @Frozen#.<br>• After successfully absorbing Half-Tulpas, will enter Rage for @15s~25s#: Al RES increases @+200%# and heals @12.5%# HP.<br>• When not in Rage, will charge Ultimate: Gains a Shield with @8.85%# HP, and clears all characters' E and Q CD, and revives all Energy and Fighting Spirit.<br>• If charging finishes before Shield is broken, will @directly kill all on-field characters#.",
    "26270305": "• Initially in Geohuman state: All RES @200%#, every Pyro hit @+2%# charge, Pyro application @+3.2%# charge per 1U.<br>• When fully charged, evolves into Molten Dragon: @Permanent Pyro aura#, Pyro RES @200%#, other RES @45%#, every Pyro hit @+1%# charge, Pyro application @+1.6%# charge per 1U. When hit by @Cryo# or @Hydro#, loses @22%# charge.<br>• When fully charged again, becomes Weakened: All RES @10%# for @17s#, then returns to Geohuman form.",
    "24090504": "• After entering battle, immediately enters Enhanced State: All RES @270%#, and accumulates Energy to perform spinning attacks.<br>• When Enhanced, if you @keep dealing Cryo DMG# at a higher frequency than @once per 0.6s#, it will enter Low Energy state: Cryo RES becomes @-30%#, other RES @30%#, and generates Elemental Particles that revive @36# Energy the first time it enters this state.<br>• When Enhanced, if it detects characters uing @Nightsoul#, will enter a special state: All RES @110%#, and switch to attacking with exceedingly powerful tracking rays.",
    "55602": "• Will summon 3 hats, hide in one of them and quickly switch their positions. If the hat he is hiding in takes @Electro-Charged# or @Lunar-Charged# DMG, will pause switching.<br>• The hat's has @36%#~@40%# HP. Its all RES @greatly increases# except @Hydro# and @Electro#, and takes @300%# increased @Electro-Charged# and @Lunar-Charged# DMG.<br>• Defeat the hat @he is hiding in# to weaken him (all RES @massively decreases#). @Electro-Charged# and @Lunar-Charged# DMG is @significantly more efficient#.<br>• Upon being weakened, will lose HP equal to @12%# non-Hydro/Electro DMG + @100%# Hydro/Electro DMG taken by Hat, not exceeding @120%# of Hat's HP.",
    "22121604": "• When not Weakened, always has Void Barrier: Requires @150# Elemental hits to break. Nightsoul attacks count as @3# hits.<br>• When Void Barrier is broken, will become weakened and lose HP equal to @10%# non-Nightsoul DMG + @60%# Nightsoul DMG taken by Void Barrier, not exceeding @30%# Max HP.<br>• If Void Barrier is not broken in time, will cast Ultimate, directly defeating the active character.",
    "28021305": "• Each hit @+3# charge. Every second charge @-4#.<br>• When charge reaches @30#, will gain a @32U# Electro Shield. Now every hit triggers a Counter, @dealing great DMG#.",
    "24030305": "• When HP reaches @75%#/@50%#/@25%#, will @Lock HP# and increase RES by @200%# agains the Element it took most DMG from in the previous cycle.<br>• Initially in @Ground State#. If it maintains the @same Element RES increase# for a long period of time, will switch to @Airborne State#.<br>• Attacking its Weaknesses will @not affect it#, and will @not clear its RES increase#.",
    "26162605": "• Will generate @Hermit Seeds# that explode after a short interval. If Seeds take @Pyro DMG#, will deal @massive DMG# to characters.<br>• Upon taking @any type of Bloom DMG#, Hermit Seeds will be converted, dealing DMG to the Boss equal to @500%# of Bloom DMG taken, but not exceeding 1500000.<br>• When the battle starts, the enemy will @rise into the air#. Convert @6# Seeds to break the Shield and reduce all RES by @40%#. Otherwise it will @directly defeat the active character#.",
    "61626": "• Will generate @Hermit Seeds# that explode after a short interval. If Seeds take @any type of Bloom DMG#, they will be converted, dealing DMG to the Boss equal to @500%# of Bloom DMG taken, but not exceeding 1500000.<br>• When the battle starts, the enemy will @rise into the air#. Convert @6# Seeds to break the Shield and reduce all RES by @40%#. Otherwise it will deal massive DMG and increase all RES by @70%#.",
    "23079405": "• Will gain @3# layers of Shields, each @4.5%# Max HP. The Shield takes @600%# increased Electro-Charged DMG and @200%# increased Lunar-Charged DMG, and increases all RES except Electro by @60%#.<br>• Shield increases all RES except Electro by @60%#, and @self-repairs very quickly#. After taking @Electro-Charged# or @Lunar-Charged# DMG, self-repair almost pauses.<br>• Break all Shields within a certain time to weaken the Boss: All RES decreases by @50%#. After recovery, Electro RES decreases by @60%#.<br>• When each layer is broken, loses @6%# HP and generates Elemenral Orbs: Regenerates @18# Electro Energy and @6# other Energy.",
    "30791": "• Will gain @3# layers of Shields, each @6%# Max HP. The Shield takes @600%# increased @Electro-Charged# DMG and @200%# increased @Lunar-Charged# DMG.<br>• Break all Shields within a certain time to weaken the Boss: All RES decreases by @50%#. After recovery, Electro RES decreases by @60%#.<br>• When each layer is broken, loses @6%# HP andgenerates Elemenral Orbs: Regenerates @18# Electro Energy and @6# other Energy.",
    "307910": "• Will gain @3# layers of Shields, each @3%# Max HP. The Shield takes @600%# increased @Electro-Charged# DMG and @200%# increased @Lunar-Charged# DMG.<br>• Break all Shields within a certain time to weaken the Boss: All RES decreases by @50%#. After recovery, Electro RES decreases by @60%#.<br>• When each layer is broken, loses @6%# HP andgenerates Elemenral Orbs: Regenerates @18# Electro Energy and @6# other Energy.",
    "63001": "• Will cause all characters to @lose HP based on Max HP#, DMG dealt @-10%#, incoming heal @-10%#, Crit Rate @-10%#.<br>• When each character @heals to Max HP#, their debuffs will be removed, and their Crit Rate @+15%#, DMG dealt @+50%#.",
    "63011": "• Will cause all characters to @lose HP based on Max HP#, DMG dealt @-50%#, incoming heal @-40%#, Crit Rate @-100%#.<br>• When each character @heals to Max HP#, their debuffs will be removed, and their Crit Rate @+15%#, DMG dealt @+50%#.",
    "41001": "• Will periodically @increase all RES# and summon @5 Ducks#, each consuming @5%# Boss HP when defeated. Defeat all Ducks to weaken the Boss and @reduce all RES#.<br>• Ducks have @26%# HP, Electro RES @10%#, other RES @150%#. Will be automatically defeated after taking @Electro-Charged# or @Lunar Charged# DMG @10# times.",
    "801": "• In normal state, is @immune to corresponding Element#.<br>• In Enhanced State, corresponding RES @100%#, other RES @60%#, exits after taking corresponding Element DMG or Lunar Reaction DMG a certain number of times.<br>• Abyss Version: Enters Enhanced State immediately. The number of DMG hits required to exit is increased. Corresponding RES becomes @170%# and other RES @130%#."
}

