        "Desc": "단단한 바위 껍데기를 가지고 있는 소형 용 도마뱀.\n행동이 아주 민첩하여 무시할 수 없는 적이다. 수메르 아카데미아의 연구에 따르면 이런 동물은 새끼일지라도 「용」이 될 수 있는 잠재력을 갖추고 있다고 한다. 천재지변이나 천적을 마주치지 않는다면, 언젠가 높은 산을 뒤흔들 정도로 거대한 마물이 될지도 모른다",
