        "Desc": "몬드의 「바람 사신수」 중 하나인 동풍의 용 드발린.\n기나긴 세월과 끝없는 어둠 속에선 투명한 보석도 먼지가 쌓여 빛을 잃고, 오만한 용도 침식으로 인해 원한으로 가득 차게 됐다.\n하지만 먼지는 닦아내면 되고, 의심과 독 또한 부술 수 있다는 것을 잊으면 안 된다\n\n<i>「자유롭게 날아봐.</i>\n<i>「그때 우리가 만났을 때처럼. 난 바람의 노래를 부르며 대지 위를 걷고 있었고, </i>\n<i>「넌 공기조차 희박한 하늘에서 세상을 내려다보고 있었지</i>\n<i>「지금은 하늘에 눈보라도 없고, 땅엔 온통 녹색 잔디가 가득해 아주 아름다울 거야.</i>\n<i>「너도 땅 위를 걸어보고, 먼 곳에서 전해지는 목가와 풍경의 노래를 들어보고, 꿀처럼 다디단 술을 마셔보았다면 이해할 수 있겠지.</i>\n<i>「네가 나였다면, 푸른 하늘을 누비는 고고하고 아름다운 네 자태를 볼 수 있을 텐데. </i>\n<i>「그랬다면 너도 알 수 있겠지. 이런 하늘과 땅을 지키기 위해 싸울 가치가 있다는 걸」</i>",
