        "Desc": "우인단의 11번째 집행관, 「타르탈리아」.\n불길한 「사안」으로부터 힘을 얻고, 암흑의 땅에서 익힌 무예로 싸운다.\n\n끝없는 투쟁을 원하는 순수한 전사.\n그에게 있어 피 튀기는 분쟁과 목숨을 건 도전은 모두 쾌감 가득한 시련이다.\n젊은 「타르탈리아」의 화려한 전적은 사람들에게 널리 알려져 있다.\n그러나 정작 본인은 이를 대수롭지 않게 여긴다.\n\n왜냐하면…\n<i>「네 운명은 분쟁의 중심이 될 거야.</i>\n<i>「철검이 맞닿는 소리는 언제나 너와 함께하는 음악일 테지.</i>\n<i>「암흑의 땅에 발을 들인 어두운 기억이,</i>\n<i>「네가 세상을 뒤엎는 힘이 될 거야」</i>",
