        "Desc": "우인단 집행관 서열 8위 「시뇨라」\n사안의 권능을 행사하는 다른 우인단과는 달리 그녀에게 사안이란 모든 걸 집어삼키는 자신의 화염을 억제하는 기물이다. 살상 무기보다 구금 도구에 더 가깝다.\n이는 오랜 세월 축적된 잔재로 사안의 봉인을 뚫고 그녀에게 덧칠한 일그러진 화장이다.\n\n눈동자에 붉은 새벽녘이 비치자 그녀는 화염의 날개를 펼쳐 여명을 향해 날아간다.\n<i>「친애하는 로잘린, 그건 서광이 아니라 모든 걸 불태워버리는 불바다야」</i>빛 속에서 한 목소리가 그녀에게 속삭인다.\n\n하지만 상관없다. 그녀는 자신이 이미 화염에 삼켜졌다는 것을 알고 있었기에",
