        "Name": "마가츠 미타케 나루카미노 미코토",
        "Title": [
            "라이덴의 이나즈마 전하"
        ],
        "Desc": "라이덴 쇼군의 권능을 대행하는 인형, 「영원함」을 위협하는 적을 상대할 때 나타난다.\n라이덴 에이(影)는 「영원함」의 조력자로 의심을 가져본 적도 두려움을 느껴본 적도 없다. 아무런 잡념 없이 항상 최선을 다할 뿐.\n그녀는 마코토와 에이(影)가 존재하던 시대에, 에이(影)가 그녀와 비슷한 책임을 짊어지고 수많은 고통과 상실을 겪었다는 얘길 들었다.\n두 개의 그림자가 겹쳐진 순간, 그녀는 「그녀」의 영원함에 대한 의지 위에 남겨진 무수히 많은 상흔밖에 볼 수 없었다. 윤회가 나의 운명이라면, 그 뜻에 따라 전쟁을 선언하는 수밖에.\n\n<i>이 몸은 드높은 위엄을 상징하고, 나라를 다스리는 권력을 부여받았으며, 「라이덴 쇼군」의 모든 것이 응축된 몸이다</i>\n<i>당연히 에이가 앞으로 나아갈 때 끊임없이 무언가를 잃은 고통, 그리고 영원함에 도달하고자 하는 결심도 이어받았지</i>\n<i>결심, 용기, 사랑, 원한… 전부 시간의 흐름 속에서 변질하고 왜곡되지</i>\n<i>오로지 「법칙」만이 영원하다</i>",
