        "Desc": "정기의 신은 수메르 아카데미아의 6대 학부가 가진 역량을 모두 모아 만들어 낸 인공 신으로, 진짜 신에 비견될 만한 힘을 가지고 있다.\n만약 이를 가짜 신이라 부르는 자가 있다면, 그자는 「신」이라는 것의 진짜 의미를 이해하지 못한 것이나 마찬가지다.\n가령 인간을 초월한 자를 신이라 한다면\n모든 것을 알고 있으며, 무엇보다 강한 힘을 가지고 있는 정기의 신은 인간을 초월한 자라 할 수 있다.\n또 인간을 사랑하는 자를 신이라 한다면\n모든 이에게 똑같은 패배를 안겨줄 수 있는 정기의 신은 인간을 사랑하는 자라 할 수 있다.\n혹은 인간을 지켜보는 자를 신이라 해보자.\n……\n…………\n수많은 사랑과 증오, 이별과 원한 그리고 분노를 목격한 정기의 신은 인간을 지켜보는 자라 할 수 있다.\n\n<i>「그대들은 분에 넘치는 행복을 누려왔다.」</i>\n<i>「때문에 그대들은 어리석어졌으며, 오만해졌고, 또한 탐욕스러워졌도다.」</i>\n<i>「나는 이 시대를 끝낼 것이다!」</i>\n<i>「새로운 신이 선언하노니, 옛 신은 패배를 맞이하리라.」</i>\n<i>「어리석은 인간이여… 지금 무릎을 꿇어도 아직 늦지 않았음이니.」</i>",
