        "Name": "기원 오아시스의 파수꾼",
        "Title": [
            "「불씨」를 받아 소생한 생명"
        ],
        "Desc": "한때 아펩은 자손들과 함께 풀의 바다와 거대한 거목 그리고 끝없이 펼쳐진 넝쿨 속에서 물 만난 고기처럼 헤엄쳤다. 초목이 시들어 먼지가 되고 모래처럼 작은 생명들이 그들의 땅에서 취약한 도시국가를 세우기 전까지 말이다.\n한때 아펩은 자손들과 함께 사막을 휘저었고 성벽은 나뭇잎처럼 떨어졌다. 모래바다의 왕과 고향을 잃은 왕이 서로 화해하고서야, 햇빛 아래 모래 언덕은 인간과 신의 것이 되었고, 용의 오아시스는 용의 마음속에 남게 되었다.\n한때 아펩은 자식들과 함께 진화의 지식을 공유했다. 흐르는 물은 부패하지 않지만 나무는 언젠가 반드시 쓰러지기 때문이다. 하지만 사막의 왕과의 약속을 이행하고 궁극의 지혜를 얻자 그의 눈앞에는 최후의 풍경밖에 보이지 않았다, 끝없는 종말 말이다.\n한때 아펩은 홀로 최후의 풍경에 빠졌다. 모든 인간, 신, 용, 들짐승, 새, 물고기와 모든 기억, 지혜, 말 그리고 증오는 색 없는 가루가 되었고 마지막 달빛은 밝은 불의 비가 되어 황야에 내렸다.\n…\n한때 아펩은 고향 잃은 왕의 행궁이 아닌 모래바다 아래를 자신의 무덤으로 여겼다. 그러나 「지혜」의 독은 곧 그를 무수히 많은 달이 지나간 세월의 증오와 분노에서 해방시킬 것이다. 그는 색 없는 최후의 경치에 염증을 느꼈고 마침내 젊은 신과 금색의 여행자를 통해 떠올렸기 때문이다, 비록 자신이 지배하던 푸른 땅은 도금된 황야가 되었고 자신의 자손은 생존을 위해 뒤틀려졌으나, 여전히 마음속 한구석에 오아시스의 경치를 품고 있었다는 것을 말이다",
        "Color": "Grass",
