        "Desc": "우인단 집행관 서열 4위, 「아를레키노」.\n그녀의 운명 속에 흐르는 고대 재액의 달의 피는 왕조가 가졌던 갈망, 힘, 또는 저주를 포함한 모든 것을 부여했다.\n그녀는 짧은 세월 속에서 선조들이 검은 태양이 떠오를 때 독을 삼키던 것처럼 수많은 고난을 목격하고 삼켰다.\n\n그럼에도 그녀에게 있어 고난과 운명은 결코 치명적인 독이 아니었다.\n그건 벽난로 속에서 조용히 타오르는 장작이었으며, 아이들에게 온기를 가져다주는 난롯불이었다.\n\n여전히 희미한 난롯불은 언젠가는 구세계의 모든 것을 불태우고 재액의 달의 마지막 혈족까지 불태울 것이다.\n아직 앳된 아이들은 언젠가는 과거의 운명을 부수고 그녀가 꿈꾸는 눈물 없는 미래를 맞이할 것이다.\n하지만 그 여명이 다가오기 전까지는 페르엘이라는 이름의 사람이 그 연약하고 아름다운 꿈을 파수하리라.\n\n<i>「운명이 창백한 여행길을 깔아준다면 재액의 달의 핏빛으로 물들여야겠지」</i>\n<i>「꺼져가는 촛불이라도 여명이 오기 전에 고난과 액운을 모조리 불태우기에는 충분해」</i>",
