        "Desc": "뒷다리가 튼튼하고 꼬리가 복슬복슬하며, 볼주머니 숨겨둔 화염류탄 열매 끈끈이로 멀리 있는 물건을 감쌀 수 있는 용.\n전설에 따르면, 숲룡은 원래 관찰하기 힘들 정도로 작았다고 한다. 심지어 바람을 타고 자유롭게 움직일 수 있으며, 다른 거대한 용의 몸에 달라붙거나 구름처럼 무리 지어 이동하기도 했다고 한다. 하지만 능력이 퇴화한 후 형태를 유지하기 위해 지금의 모습을 선택할 수밖에 없었다",
