            "D": "버섯몬이 진화한 형태. <color=#FFE14BFF>번개 원소 공격</color>을 받아 격화 반응이 일어나면 「활력도」가 누적 됩니다. <color=#FFE14BFF>불 원소 공격</color>을 받으면 「활력도」가 감소합니다. 「활력도」가 최대치까지 누적되면 <color=#FFE14BFF>활력 상태</color>가 됩니다. 활력 상태의 공포의 취령 버섯은 탈진될 때까지 맹렬한 공격을 퍼붓습니다. 활력 상태가 아닌 공포의 취령 버섯이 <color=#FFE14BFF>불 원소</color> 공격을 받아 연소 상태에 빠지면 건조 상태로 변하고, 사방에 포자를 흩뿌려 버섯몬을 소환하여 해당 상태에서 벗어나려 합니다"
